api-help-param-list:
Used to display the possible values for a parameter taking a list of values

Parameters:
* $1 - 1 if the parameter takes one value, 2 if the parameter takes any number of values
* $2 - Comma-separated list of values, possibly formatted using {{msg-mw|api-help-param-list-can-be-empty}}
{{Identical|Value}}

api-help-param-default:
Used to display the default value for an API parameter

Parameters:
* $1 - Default value

See also:
* {{msg-mw|api-help-param-default-empty}}
{{Identical|Default}}

api-help-param-default-empty:
Used to display the default value for an API parameter when that default is an empty value

See also:
* {{msg-mw|api-help-param-default}}
